import React from 'react'
import { RouterProvider, createBrowserRouter } from 'react-router'
import Login from './Screen/Login'

const Routers = () => {

    const router = createBrowserRouter([
        {path: '/', element: <Login/>}
    ])

  return (
    <RouterProvider value={router}/>
  )
}

export default Routers
